import React from "react";

const About = () => {
  return (
    <div className='page'>
      <div className='container'>
        <div className='row'>
        <h3>Perfect balance between software house skills and digital agency sensibility. If you are focused on delivering functional and usable project, with outstanding design, you are in a right place, so don't wait and get known about us more.k</h3>
        </div>
      </div>
    </div>
  );
};

export default About;
